// GetKeywordID returns the lex id of the SQL keyword k or IDENT if k is
// not a keyword.
//
//gcassert:inline
func GetKeywordID(k string) int32 {
	id, ok := keywordID[k]
	if !ok {
		return IDENT
	}
	return id
}
